import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import { Button } from 'react-bootstrap';

const Header = () => 
{
    return (
        <Navbar bg="dark" data-bs-theme="dark">
            <Container className='p-0'>
            <Navbar.Brand href="#home">BlackoutStore</Navbar.Brand>
            <Nav className="me-auto">
                <Nav.Link href="#home">Main page</Nav.Link>
                <Nav.Link href="#features">My orders</Nav.Link>
                <Nav.Link href="#pricing">About us</Nav.Link>
            </Nav>
            <Nav>
                <Button variant="light" /*onClick={()=> ShowAuthModalForm()}*/  className='m-1'>Login</Button>
                <Button variant="danger" /*onClick={()=>{ Logout() }}*/ className='m-1'>Logout</Button>
            </Nav>
            </Container>
        </Navbar>
    );
}

export default Header;
